const allCities = [];
const CitiesAndCodes = () => {
  fetch("http://localhost:3000/", {
    method: "GET",
    headers: { "Content-Type": "application/json" },
  }).then((response) =>
    response.json().then((data) => {
      allCities.push(data);
    })
  );
  dispatch({ type: "fetchedCityCodes" });
};
export default CitiesAndCodes;
